import './App.css';
import Create from './components/Create';
import login from './components/login';
import {BrowserRouter} from "react-router-dom" 

function App() {
  return (
    <div className="App">
    <div className="main">
    </div>
     <Create />
     <Route path="/login" component={<login/> } /> 
    </div>
  );
}

export default App;
